import styles from './Home.module.css'


function Home(){
    return (
        <section className={styles.home_container}>
            <h1><span>Projeto_A3</span></h1>
            <p>Olá, Meu nome é <span>Marlus Roberto</span> </p>
            <a href="/">Criar Projeto</a>
        </section>
    )
}

export default Home
